	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
	  134379,"0",1892,NULL,1968,
	  "0.35 USD",28.000,NULL,"Early printings by Apex Novelties. Later printings by Print Mint and Last Gasp with the Apex Novelty logo still on the cover. Indicia marked \"© October 1967 - R. Crumb.\"Underground Comix are known for using different prices covers (art or color variations) and/or interior content to distinguish between printings. 1st-5th prints have 0.35 USD cover price.1st has hairline mark in Z on front cover. Pages numbered upper right in interior.2nd has no hairline mark or page numbers.3rd-5th have scratches and retouching to guy's spine on cover.6th print has 0.50 USD cover. 7th print has 0.60 USD cover. 8th print has 0.75 USD cover.9th print has 1.50 USD cover. 10th print has 2.50 USD cover. 11th print has 2.95 USD cover.12th? print has 3.95 USD cover. 13th print has 4.95 USD cover.First edition is known to exist as untrimmed with a 1/4-inch white bar around 3 sides that was never trimmed.As stated in Mark James Estren's \"A History of Underground Comics\" this was actually published after Zap #2 came out in 1968. The artwork for this issue was lost after the publisher who had it moved to India. Luckily Crumb had made xeroxes which he managed to locate months later. Crumb did get the original artwork back several years later.",
	  NULL,NULL,NULL,NULL,NULL,NULL
	  );INSERT INTO issue(id, number, series_id, indicia_publisher_id, publication_date, price, page_count, indicia_frequency, notes, isbn, valid_isbn, barcode,title, on_sale_date, rating) VALUES(
